import React from "react";
import { styled } from "styled-components";
import { front } from "../../constant/stackList";

export default function StackList() {
  const frontStack = front;
  const category = ["FRONTEND", "BACKEND"];

  return (
    <Container>
      {category.map((item) =>
        item === "FRONTEND" ? (
          <React.Fragment>
            <p>{item}</p>
            {Object.keys(frontStack).map((stack) => (
              <li>{frontStack[stack]}</li>
            ))}
          </React.Fragment>
        ) : (
          <></>
        )
      )}
    </Container>
  );
}

const Container = styled.div`
  width: 100%;
  padding: 20px;
  background-color: white;
`;
